  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for North
  Platte National Wildlife Refuge outlines Refuge accomplishments during the 1979
  calendar year. The report begins by describing the climate and habitat conditions
  in the Refuge, as well as the land acquisition program and system status. The construction
  and maintenance section describes physical developments and maintenance. The habitat
  management section discusses grasslands and wetlands. Wildlife- including endangered
  and threatened species, migratory birds, big game animals, and raptors- are discussed.
  The public relations sections describes recreational uses and enforcement. Items
  of interest  and photographs are attached.\",\n\t\"license_title\": \"License Not
